  return (
    <Box
      component="section"
      sx={{
        height: '100%', 
        width: {
          xs: '100%',
          sm: '100%', 
          lg: '80%'
        },
        display: 'flex', 
        flexDirection: 'column', 
      }}
    >
      <Box 
        component="div" 
        sx={{
          flex: 1, 
          bgcolor: "lightblue",
          overflow: 'auto', 
        }}
      >
        hello1
      </Box>

      <Box 
        component="div" 
        sx={{
          height: "55px",
        }}
      >
       <ChatInput/>
      </Box>
    </Box>
  );
};

export default ChatInterface;
